sealed class UniException: kotlin.Exception() {
    
    class BinaryOptions(
        
        val v1: kotlin.String
        ) : UniException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    class PocketOption(
        
        val v1: kotlin.String
        ) : UniException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    class Uuid(
        
        val v1: kotlin.String
        ) : UniException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    class Validator(
        
        val v1: kotlin.String
        ) : UniException() {
        override val message
            get() = "v1=${ v1 }"
    }
    

    companion object ErrorHandler : UniffiRustCallStatusErrorHandler<UniException> {
        override fun lift(error_buf: RustBuffer.ByValue): UniException = FfiConverterTypeUniError.lift(error_buf)
    }

    
}

/**
 * @suppress
 */
public object FfiConverterTypeUniError : FfiConverterRustBuffer<UniException> {
    override fun read(buf: ByteBuffer): UniException {
        

        return when(buf.getInt()) {
            1 -> UniException.BinaryOptions(
                FfiConverterString.read(buf),
                )
            2 -> UniException.PocketOption(
                FfiConverterString.read(buf),
                )
            3 -> UniException.Uuid(
                FfiConverterString.read(buf),
                )
            4 -> UniException.Validator(
                FfiConverterString.read(buf),
                )
            else -> throw RuntimeException("invalid error enum value, something is very wrong!!")
        }
    }

    override fun allocationSize(value: UniException): ULong {
        return when(value) {
            is UniException.BinaryOptions -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.v1)
            )
            is UniException.PocketOption -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.v1)
            )
            is UniException.Uuid -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.v1)
            )
            is UniException.Validator -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.v1)
            )
        }
    }

    override fun write(value: UniException, buf: ByteBuffer) {
        when(value) {
            is UniException.BinaryOptions -> {
                buf.putInt(1)
                FfiConverterString.write(value.v1, buf)
                Unit
            }
            is UniException.PocketOption -> {
                buf.putInt(2)
                FfiConverterString.write(value.v1, buf)
                Unit
            }
            is UniException.Uuid -> {
                buf.putInt(3)
                FfiConverterString.write(value.v1, buf)
                Unit
            }
            is UniException.Validator -> {
                buf.putInt(4)
                FfiConverterString.write(value.v1, buf)
                Unit
            }
        }.let { /* this makes the `when` an expression, which ensures it is exhaustive */ }
    }

}




